import './App.css';
import {NavLink} from "react-router-dom";
import home from './home'


function App() {
  return (
    <>
    <Router>
      <Switch>
        <Route exact path ="/" Component = {Home}></Route>
      </Switch>
    </Router>

    </>
  );
}

export default App;
